// Solution 1:
const replaceDWithFAndI = (arr) => {
    let fCount = 0;
    for(let i=0; i<arr.length-1; i++) {
        if(arr[i] === 'd' && arr[i+1] === 'd') {
            fCount++;
        } else if(arr[i] === 'd' && arr[i+1]!== 'd') {
            arr[i] = 'f';
        }
    }

    for(let j=0; j<arr.length-1; j++) {
        if(arr[j] === 'f' && arr[j+1] === 'a') {
            arr[j+1] = 'i';
        }
    }

    for(let k=0; k<fCount; k++) {
        const index = arr.indexOf('f');
        arr[index] = 'i';
    }
}

