    for(let i=0; i<arr.length-1; i++) {
        if(arr[i] === 'd' && arr[i+1] === 'd') {
            arr[i] = 'f';
        }
    }

    // Change f to i when it is followed by a
    for(let j=0; j<arr.length-1; j++) {
        if(arr[j] === 'f' && arr[j+1] === 'a') {
            arr[j+1] = 'i';
        }
    }

    // Count the number of f and change them all to i
    let count = 0;
    for(let k=0; k<arr.length; k++) {
        if(arr[k] === 'f') {
            count++;
        }
    }

    for(let l=0; l<count; l++) {
        const index = arr.indexOf('f');
        arr[index] = 'i';
    }
}
